import React, { useState, useRef, useEffect } from 'react';
import { MessageCircle, X, Send, Bot } from 'lucide-react';

interface Message {
  text: string;
  isBot: boolean;
  timestamp: Date;
}

const Chatbot: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [messages, setMessages] = useState<Message[]>([
    { text: "Hi! I'm SehatNama Assistant. How can I help you today?", isBot: true, timestamp: new Date() }
  ]);
  const [input, setInput] = useState('');
  const messagesEndRef = useRef<HTMLDivElement>(null);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  };

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const getBotResponse = (userMessage: string): string => {
    const msg = userMessage.toLowerCase();

    if (msg.includes('hello') || msg.includes('hi') || msg.includes('hey')) {
      return "Hello! Welcome to SehatNama. I can help you find doctors, book appointments, or answer questions about our services.";
    }
    if (msg.includes('book') || msg.includes('appointment')) {
      return "To book an appointment, search for a doctor by specialty or location, then click 'Book Appointment' on their profile. You'll need to sign in first.";
    }
    if (msg.includes('doctor') || msg.includes('find')) {
      return "You can find doctors by using our search bar. Filter by specialty, location, or name. We have 500+ verified doctors across India!";
    }
    if (msg.includes('cancel')) {
      return "To cancel an appointment, go to 'My Appointments' section and click the 'Cancel' button on your scheduled appointment.";
    }
    if (msg.includes('price') || msg.includes('fee') || msg.includes('cost')) {
      return "Consultation fees vary by doctor and specialty. You can see each doctor's fee on their profile card. Average fees range from â‚¹300-â‚¹1500.";
    }
    if (msg.includes('location') || msg.includes('near')) {
      return "Click 'Use my location' in the search bar to find doctors near you. We'll show distances and help you find the closest healthcare providers.";
    }
    if (msg.includes('specialty') || msg.includes('specialties')) {
      return "We have doctors in 50+ specialties including Cardiology, Dermatology, Neurology, Orthopedics, Pediatrics, and more!";
    }
    if (msg.includes('emergency') || msg.includes('urgent')) {
      return "For medical emergencies, please call 108 (India Emergency) or visit the nearest hospital. Our platform is for scheduled consultations.";
    }
    if (msg.includes('payment') || msg.includes('pay')) {
      return "We accept multiple payment methods including UPI, Credit/Debit cards, and Net Banking. All payments are secure and encrypted.";
    }
    if (msg.includes('hours') || msg.includes('time') || msg.includes('available')) {
      return "Our platform is available 24/7. Doctor availability varies - check their profile for specific consultation hours.";
    }
    if (msg.includes('contact') || msg.includes('support')) {
      return "You can reach our support team at:\nðŸ“ž +91 1800-123-4567\nðŸ“§ support@sehetnama.com\nWe're available 24/7!";
    }
    if (msg.includes('thank')) {
      return "You're welcome! Feel free to ask if you need anything else. Stay healthy! ðŸ˜Š";
    }

    return "I can help you with:\nâ€¢ Finding doctors\nâ€¢ Booking appointments\nâ€¢ Canceling appointments\nâ€¢ Payment information\nâ€¢ Contact support\n\nWhat would you like to know?";
  };

  const handleSend = () => {
    if (!input.trim()) return;

    const userMessage: Message = {
      text: input,
      isBot: false,
      timestamp: new Date()
    };

    setMessages(prev => [...prev, userMessage]);
    setInput('');

    setTimeout(() => {
      const botMessage: Message = {
        text: getBotResponse(input),
        isBot: true,
        timestamp: new Date()
      };
      setMessages(prev => [...prev, botMessage]);
    }, 500);
  };

  const handleKeyPress = (e: React.KeyboardEvent) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      handleSend();
    }
  };

  return (
    <>
      {/* Chat Button */}
      {!isOpen && (
        <button
          onClick={() => setIsOpen(true)}
          className="fixed bottom-6 right-6 w-16 h-16 bg-gradient-to-r from-blue-600 to-purple-600 text-white rounded-full shadow-2xl hover:shadow-3xl transform hover:scale-110 transition-all duration-300 flex items-center justify-center z-50 animate-bounce"
        >
          <MessageCircle className="h-7 w-7" />
        </button>
      )}

      {/* Chat Window */}
      {isOpen && (
        <div className="fixed bottom-6 right-6 w-96 h-[600px] bg-white rounded-2xl shadow-2xl flex flex-col z-50 border border-gray-200 overflow-hidden">
          {/* Header */}
          <div className="bg-gradient-to-r from-blue-600 to-purple-600 text-white p-4 flex items-center justify-between">
            <div className="flex items-center space-x-3">
              <div className="w-10 h-10 bg-white bg-opacity-20 rounded-full flex items-center justify-center">
                <Bot className="h-6 w-6" />
              </div>
              <div>
                <h3 className="font-bold text-lg">SehatNama Assistant</h3>
                <p className="text-xs text-blue-100">Online â€¢ Always here to help</p>
              </div>
            </div>
            <button
              onClick={() => setIsOpen(false)}
              className="hover:bg-white hover:bg-opacity-20 rounded-full p-2 transition-all"
            >
              <X className="h-5 w-5" />
            </button>
          </div>

          {/* Messages */}
          <div className="flex-1 overflow-y-auto p-4 space-y-4 bg-gray-50">
            {messages.map((message, index) => (
              <div
                key={index}
                className={`flex ${message.isBot ? 'justify-start' : 'justify-end'}`}
              >
                <div
                  className={`max-w-[80%] rounded-2xl px-4 py-3 ${
                    message.isBot
                      ? 'bg-white text-gray-800 shadow-md border border-gray-200'
                      : 'bg-gradient-to-r from-blue-600 to-purple-600 text-white shadow-lg'
                  }`}
                >
                  {message.isBot && (
                    <div className="flex items-center space-x-2 mb-1">
                      <Bot className="h-4 w-4 text-blue-600" />
                      <span className="text-xs font-semibold text-blue-600">Assistant</span>
                    </div>
                  )}
                  <p className="text-sm whitespace-pre-line leading-relaxed">{message.text}</p>
                  <p className={`text-xs mt-1 ${message.isBot ? 'text-gray-400' : 'text-blue-100'}`}>
                    {message.timestamp.toLocaleTimeString('en-US', { hour: '2-digit', minute: '2-digit' })}
                  </p>
                </div>
              </div>
            ))}
            <div ref={messagesEndRef} />
          </div>

          {/* Input */}
          <div className="p-4 bg-white border-t border-gray-200">
            <div className="flex items-center space-x-2">
              <input
                type="text"
                value={input}
                onChange={(e) => setInput(e.target.value)}
                onKeyPress={handleKeyPress}
                placeholder="Type your message..."
                className="flex-1 px-4 py-3 border border-gray-300 rounded-xl focus:ring-2 focus:ring-blue-500 focus:border-transparent text-sm"
              />
              <button
                onClick={handleSend}
                disabled={!input.trim()}
                className="bg-gradient-to-r from-blue-600 to-purple-600 text-white p-3 rounded-xl hover:shadow-lg transform hover:scale-105 transition-all disabled:opacity-50 disabled:cursor-not-allowed"
              >
                <Send className="h-5 w-5" />
              </button>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default Chatbot;
